            flw ft2, 2036(a1)
            fmadd.s ft2, ft1, fs1, ft2
            fsw ft2, 2036(a1)

            flw ft2, 1012(a1)
            fmadd.s fs5, ft1, ft2, fs5
        skip_backprop_k631:

        //k=2
        bnez t2, skip_backprop_k632
            flw ft2, 2040(a1)
            fmadd.s ft2, ft1, fs2, ft2
            fsw ft2, 2040(a1)

            flw ft2, 1016(a1)
            fmadd.s fs6, ft1, ft2, fs6
        skip_backprop_k632:

        //k=3
        bnez t3, skip_backprop_k633
            flw ft2, 2044(a1)
            fmadd.s ft2, ft1, fs3, ft2
            fsw ft2, 2044(a1)

            flw ft2, 1020(a1)
            fmadd.s fs7, ft1, ft2, fs7
        skip_backprop_k633:
    skip_backprop_i63:


