    //----------------------------------------------------------------

    //Reminder
    //fs11 = 1.0
    //h10 = [fs0, ..., fs3]
    //dL/dh10 = [fs4, ..., fs7]
    //s5 = floats_ht
    //s6 = floats_ct
    //s7 = floats_tanhct
    //0(s8)   = it
    //160(s8) = ft
    //320(s8) = gt
    //480(s8) = ot
