    //s2 = weights_floats_hidden
    //s3 = biases_floats_input
    //s4 = biases_floats_hidden

    //ht & ct
    la s5, floats_ht
    la s6, floats_ct

    //reset s7 (tanh(ct))
    la s7, floats_tanhct

    // reset i, f, g and o adress
